import React from 'react'
import { useParams } from 'react-router-dom'
import { useGetFindTodoRTKQuery } from '../redux/api/todortkquery'

function Detail() {
  const {id} = useParams()
  const {data} = useGetFindTodoRTKQuery(id)

  return (
    <>
    {data && <div>
      <h2>{data.title}</h2>
      <p>ID : {data.id}</p>
      <p>{data.content}</p>
      </div>}
    </>
  )
}

export default Detail
